import React from 'react'
import { AuthProvider } from './Contexts/AuthContext';
const { setAuth } = useContext(AuthContext);

const Login = () => {
    const { auth } = useContext(AuthContext);
    console.log(auth);
    return (
        auth.success ? children : <Navigate to="/login"/>
    );
};

export default Login;
